          price: '20',
          stock: 'in stock'
        },
        {
          id: 3,
          name: 'Product 3',
          price: '30',
          stock: 'in stock'
        },
      ];

      let rows = products.map((products, index) => {
        <Product 
          key={index}
          name={products.name} 
          price={products.price} 
          stock={products.stock}
        />
      });
      return(

        <div className='container'>
          <Product price="10" stock="In Stock">Product 1</Product>
        </div>
      )
  }
}

export default App;
